// static
bool NFCClientStubDispatch::Accept(NFCClient* impl, mojo::Message* message)
{
    switch (static_cast<messages::NFCClient>(message->header()->name)) {
    case messages::NFCClient::kOnWatch: {
        DCHECK(message->is_serialized());
        internal::NFCClient_OnWatch_Params_Data* params = reinterpret_cast<internal::NFCClient_OnWatch_Params_Data*>(message->mutable_payload());

        // Validation for NFCClient.0
        bool success = true;
        WTF::Vector<uint32_t> p_watch_ids {};
        WTF::String p_serial_number {};
        NDEFMessagePtr p_message {};
        NFCClient_OnWatch_ParamsDataView input_data_view(params, message);

        if (success && !input_data_view.ReadWatchIds(&p_watch_ids))
            success = false;
        if (success && !input_data_view.ReadSerialNumber(&p_serial_number))
            success = false;
        if (success && !input_data_view.ReadMessage(&p_message))
            success = false;
        if (!success) {
            ReportValidationErrorForMessage(message, mojo::internal::VALIDATION_ERROR_DESERIALIZATION_FAILED, NFCClient::Name_, 0, false);
            return false;
        }
        // A null |impl| means no implementation was bound.
        DCHECK(impl);
        impl->OnWatch(std::move(p_watch_ids), std::move(p_serial_number), std::move(p_message));
        return true;
    }
    case messages::NFCClient::kOnError: {
        DCHECK(message->is_serialized());
        internal::NFCClient_OnError_Params_Data* params = reinterpret_cast<internal::NFCClient_OnError_Params_Data*>(message->mutable_payload());

        // Validation for NFCClient.1
        bool success = true;
        NDEFErrorPtr p_error {};
        NFCClient_OnError_ParamsDataView input_data_view(params, message);

        if (success && !input_data_view.ReadError(&p_error))
            success = false;
        if (!success) {
            ReportValidationErrorForMessage(message, mojo::internal::VALIDATION_ERROR_DESERIALIZATION_FAILED, NFCClient::Name_, 1, false);
            return false;
        }
        // A null |impl| means no implementation was bound.
        DCHECK(impl);
        impl->OnError(std::move(p_error));
        return true;
    }
    }
    return false;
}

